import React from 'react';
import { Link } from 'react-router-dom';
import siteLogo from '../images/logo-dark.png'
import toggleMenu from '../images/menu.png'
import { Nav } from 'react-bootstrap'
class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <header className="sticky-top" id="stickytop">
                <div id="site-header">
                    <Link to="/">
                        <div className="site-logo">
                            <img src={siteLogo} alt="logo" />
                        </div>
                    </Link>
                    <div className='nav-toggle'>
                        <img src={toggleMenu} alt="nav-menu" />
                    </div>
                    <div className="slide-menu">
                        <Nav activeKey="/" >
                            <Nav.Item>
                                <Link as={Nav.Link} to="/">Home</Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Link as={Nav.Link} to="/explore-work" >Explore Work</Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link href="/dm-cafe">DM Cafe</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Link as={Nav.Link} to="/about">About Us</Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Link as={Nav.Link} to="/say-hello">Say Hello</Link>
                            </Nav.Item>
                        </Nav>
                    </div>
                </div>
            </header>
        );
    }
}

Header.propTypes = {};

export default Header;
